import React from 'react';
import Card from './Card';
import contacts from './contactInfo';

const CardList = ({contacts}) => {
  const cardArray = contacts.map((user, i) => {
    return <Card id={contacts[0].id} name={contacts[0].name} email={contacts[0].email} phoneNumber={contacts[0].phoneNumber}/>;
  })
  return (
    <div>
      {cardArray}
    </div>
  );
};

export default CardList;
